import React, { Component } from 'react';
import '../App.css';
import 'bootstrap/dist/css/bootstrap.css';

class Footer extends Component{

    static defaultProps = {

    }

    constructor(props){
        super(props);

        this.state = {
            email,
            linkedin
        }
    }

    render(){

        const {state} = this;

        return(
            <div>
                <div class="row">
                    <hr></hr>
                    <div class="col-4">E-mail: { state.email }</div>
                    <div class="col-4 ">Linkedin: { state.linkedin }</div>
                    <div class="col-4"></div>
                </div>
            </div>
        );
    }
}

export default Footer;
